def bubble_sort(target):
    """
	bubble_sort algorithm
	:  O(n)
	:  O(n^2)
	: 
	:param target:
	:return: sorted target
	"""
    flag = 0
    lens = len(target)
    for i in range(0, len(target) - 1, 1):
        for j in range(0, lens - 1, 1):
            if target[j] > target[j + 1]:
                target[j], target[j + 1] = target[j + 1], target[j]
                flag = 1
            else:
                pass
        if flag == 0:
            break
        else:
            lens -= 1
    return target

