        if len(matrix[0]) == 1:
            if target == matrix[0][0]:
                return True
            else:
                return False
        inIndex = len(matrix[0]) // 2
        if target == matrix[0][inIndex]:
            return True
        elif target < matrix[0][inIndex]:
            return searchMatrix([matrix[0][:inIndex]], target)
        else:
            return searchMatrix([matrix[0][inIndex:]], target)
    else:
        out = len(matrix) // 2
        if target < matrix[out][0]:
            return searchMatrix(matrix[:out], target)
        else:
            return searchMatrix(matrix[out:], target)

