    header: bool=False, spaces: int=-1):
    """
    print_sep : a function to print tab in plain, with header or in table

    :param arr list: A list of list
    :param size int: size of arr (can be manualy calculated)
    :param error bool: 
    """
    if size < 0:
        if type(arr[0]) == list:
            size = len(arr[0])
        else:
            return
    if spaces <= 1:
        spaces = 6
    tab_size: list = []
    for i in range(size):
        local_size: int = 0
        for j in range(len(arr)):
            lg: int = len(arr[j][i])
            if local_size < lg:
                local_size = lg
        tab_size.append(local_size)
    start: int = 0
    length: int = 0
    if header:
        length = (lambda x: sum(x))(tab_size) + spaces * len(tab_size) + 3
        delimitor: str = '-' * length
